import "./App.css";
import Login from "./components/login/login";
import MobileHeader from "./components/menu/mobile-menu";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <div>
        <Link to="/header">Blogs</Link>
      </div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<MobileHeader />}>
            <Route index element={<Login />} />
            <Route path="header" element={<MobileHeader />} />
            <Route path="*" element={<Login />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
